import React, { useMemo, memo, Component } from 'react';
import styled from 'styled-components';
import PostCard from './PostCard';
import { connect } from 'react-redux';
import { PostParamsType } from '../interfacesAndTypes/RequestParams';
import { useFetchDashboardFeed } from '../hooks/dashboardFeed';
import { RootState } from '../store';


class Dashboard extends Component {

  constructor(props){
    super(props);
    this.state = {
      posts: []
    }
  }

  componentDidMount(){

  }


  render(){

  return (
	<Container>
    <PostContainer>
      {this.state.posts.length > 0  ? this.state.posts.map((post: PostParamsType)=>{
        return <PostCard key={post._id} data={post}/>
      }) : <Message>Share some memory to your wall</Message> }
    </PostContainer>
  </Container>
  )
    }
}

const Container = styled.div`
  flex: 1;
  width: 100%;
  display: flex;
  justify-content: center;
`

const PostContainer = styled.div`
  width: 500px;
  display: flex;
  flex-direction: column;
  gap: 20px;
`

const Button = styled.button`
  border: none;
	padding: 10px;
	background-color: #4834d4;
	color: #fff;
	font-weight: 600;
	font-size: 20px;
	border-radius: 4px;
	transition: all 0.1s linear;
	&:hover{
		box-shadow: 5px 5px 20px #4834d4;
	}
	cursor: pointer;
`

const Message = styled.h1`
  color: #636e72;
`

const mapStateProps = (state: RootState)=>{
  return {
    posts: state.dashboardFeed
  }
}

export default memo(Dashboard)
